INSERT INTO `kondef` (`id`, `rincian`, `keterangan`, `flag`, `created_at`, `updated_at`) VALUES
	(1, 'BLOK I. PENGENALAN TEMPAT', 'Blok ini digunakan untuk mendapatkan keterangan tentang lokasi/alamat lengkap responden dalam hal ini desa/nagari.', 0, '2020-05-20 12:20:53', NULL),
	(2, 'Provinsi', 'Tulis Nama Provinsi dengan jelas dan cantumkan kodenya pada kotak yang tersedia.', 1, '2020-05-20 12:21:27', NULL),
	(3, 'Kabupaten/Kota', 'Tulis Nama Kabupaten/Kota dengan jelas, dan cantumkan kodenya pada kotak yang tersedia.', 1, '2020-05-20 12:22:12', NULL),
	(4, 'Kecamatan', 'Tulis Nama Kecamatan dengan jelas dan cantumkan kodenya pada kotak yang tersedia.', 1, '2020-05-20 12:22:52', NULL),
	(5, 'Desa/Nagari', 'Tulis Nama Desa/Nagari dengan jelas dan cantumkan kodenya pada kotak yang tersedia.', 1, '2020-05-20 12:23:59', NULL),
	(6, 'Kode Pengenalan Tempat', 'Kode yang digunakan adalah Kode pada Master File Desa yang berada di daftar sampel yang diberikan BPS Pusat.', 1, '2020-05-20 12:24:48', NULL),
	(7, 'Jenis Wilayah Administrasi', 'Lingkari dan cantumkan kode Jenis Wilayah Administrasi pada kotak yang tersedia.', 1, '2020-05-20 12:25:09', NULL),
	(8, 'Status Desa', 'Lingkari dan cantumkan kode status desa pada kotak yang tersedia.', 1, '2020-05-20 12:25:32', NULL),
	(9, 'Alamat Lengkap Kantor Desa/Nagari', 'Tulis Alamat lengkap kantor desa/nagari dengan jelas, berikut dengan kode pos, nomor telepon, dan nomor faksimili.', 1, '2020-05-20 12:25:52', NULL),
	(10, 'BLOK II. KETERANGAN UMUM DAN SUMBER DAYA', 'Blok ini digunakan untuk mendapatkan keterangan tentang profil desa, aparatur serta keterangan lain', 0, '2020-05-20 13:31:15', NULL),
	(11, 'Keterangan Umum Kepala Desa/Wali Nagari', 'Isikan nama, umur, jenis kelamin, tahun mulai menjabat dan pendidikan terakhir.', 2, '2020-05-20 13:14:49', NULL),
	(12, 'Umur', 'dihitung dengan pembulatan ke bawah (ulang tahun terakhir).', 2, '2020-05-20 13:15:32', '2020-05-20 13:15:33'),
	(13, 'Tahun mulai menjabat', 'Tahun pertama kali menjabat sebagai kepala desa/wali nagari di desa tersebut.', 2, '2020-05-20 13:16:16', '2020-05-20 13:16:16'),
	(14, 'Banyaknya Aparatur Desa/Nagari', 'Isikan banyaknya sekretaris desa/nagari, kepala urusan, kepala seksi, kepala dusun/lingkungan/jorong dan staf lainnya berdasarkan status kepegawaiannya apakah aparatur desa tersebut seorang Pegawai Negeri Sipil (PNS) atau Non Pegawai Negeri Sipil (PNS) menurut jenis kelamin pada tempat yang tersedia kemudian jumlahkan.', 2, '2020-05-20 13:17:02', NULL),
	(15, 'Administrasi Desa/Nagari', '', 2, '2020-05-20 13:18:18', NULL),
	(16, 'Jika rincian 3.a. berkode 1', 'informasi tersebut berasal darimana.\r\nLingkari jawaban yang sesuai (bisa lebih dari satu), jumlahkan dan pindahkan pada kotak yang\r\ntersedia.', 2, '2020-05-21 22:57:58', NULL),
	(17, 'Rincian 3.b.', 'Lingkari kode 1 (Ya) jika desa/nagari membuat laporan keuangan dan kode 2 (tidak) jika tidak\r\nmembuat laporan keuangan. Pindahkan pada kotak yang tersedia.', 2, '2020-05-21 22:55:05', NULL),
	(18, 'Jika rincian 3.b. berkode 1', 'siapakah yang melakukan pencatatan/rekapitulasi laporan keuangan desa selama ini? Lingkari salah satu kode yang sesuai dan pindahkan pada kotak yang tersedia.', 2, NULL, NULL),
	(19, 'Jika rincian 3.b. berkode 2', 'apa kendalanya? Lingkari kode yang sesuai (boleh lebih dari 1), jumlahkan dan isikan pada kotak yang tersedia.', 2, NULL, NULL),
	(20, 'Rincian 3.c.', 'Lingkari kode 1 jika ada dan kode 2 jika tidak. Pindahkan pada kotak yang tersedia.', 2, '2020-05-20 13:28:55', NULL),
	(21, 'Rincian 3.d.', 'Lingkari kode 1 jika telah menggunakan komputer dan kode 2 jika tidak.', 2, '2020-05-20 13:29:42', NULL),
	(22, 'Jika rincian 3.d berkode 1', 'Apakah sistem komputerisasi yang digunakan? Lingkari kode 1 jika menggunakan siskeudes dan kode 2 jika lainnya dan sebutkan. Pindahkan pada kotak yang tersedia.', 2, '2020-05-20 13:30:17', NULL),
	(23, 'BLOK III. REALISASI PENDAPATAN/BELANJA PEMERINTAH', NULL, 0, '2020-05-20 13:32:28', NULL),
	(24, 'Pendapatan Desa', 'Yaitu semua penerimaan uang melalui rekening desa yang merupakan hak desa dalam satu tahun anggaran yang tidak perlu dibayar kembali oleh desa.', 3, NULL, NULL),
	(25, 'Pendapatan Asli Desa', 'Yaitu pendapatan yang berasal dari kewenangan Desa berdasarkan hak asal usul dan kewenangan skala lokal Desa. Pendapatan desa yang bersifat Pendapatan Asli Desa berasal dari masyarakat dan lingkungan desa.', 3, NULL, NULL),
	(26, 'Hasil Usaha', 'Yaitu sumber pendapatan lain yang dapat diusahakan oleh desa berasal dari Badan Usaha Milik Desa, pengelolaan pasar desa, pengelolaan kawasan wisata skala desa, pengelolaan tambang mineral bukan logam dan tambang batuan dengan tidak menggunakan alat berat, serta sumber lainnya dan tidak untuk dijualbelikan, misalnya hasil BUM Desa, tanah kas desa.', 3, NULL, NULL),
	(27, 'Hasil Aset', 'Pungutan atas jasa pelayanan yang diberikan pemerintah desa kepada pengguna/penerima manfaat aset desa tersebut.', 3, NULL, NULL),
	(28, 'Swadaya, Partisipasi dan Gotong Royong', 'Yaitu membangun dengan kekuatan sendiri yang melibatkan peran serta masyarakat berupa tenaga dan barang yang dinilai dengan uang.', 3, NULL, NULL),
	(29, 'Lain-lain Pendapatan Asli Desa yang Sah', 'Yaitu penerimaan yang tidak digolongkan dalam penerimaan-penerimaan tersebut di atas (4.1.1. s/d 4.1.3.). Misalnya hasil pungutan desa.', 3, NULL, NULL),
	(30, 'Transfer', 'Yaitu penerimaan desa yang berasal dari pemerintah supra desa yang menyalurkan dana kepada desa sesuai amanat ketentuan yang berlaku.', 3, NULL, NULL),
	(31, 'Dana Desa', 'Dana yang bersumber dari APBN yang diperuntukkan bagi desa yang ditransfer melalui APBD Kabupaten/Kota dan digunakan untuk membiayai penyelenggaraan pemerintahan, pelaksanaan pembangunan, pembinaan kemasyarakatan, dan pemberdayaan masyarakat.', 3, NULL, NULL),
	(32, 'Bagian dari hasil pajak dan retribusi daerah kabupaten/kota', 'Bagi hasil pajak adalah bagian pendapatan daerah yang berasal dari penerimaan pajak yang\r\ndikelola oleh pemerintahan di atasnya. sedangkan bagi hasil retribusi adalah pengembalian\r\nsebagian hasil retribusi yang diambil dari usaha maupun bukan usaha dari desa tersebut oleh\r\npemerintah di atasnya.', 3, NULL, NULL),
	(33, 'Alokasi Dana Desa (ADD)', 'Alokasi Dana Desa berasal dari APBD kabupaten/kota yang bersumber dari bagian dana\r\nperimbangan keuangan pusat dan daerah yang diterima oleh kabupaten kota untuk desa paling\r\nsedikit 10 persen setelah dikurangi Dana Alokasi Khusus.', 3, NULL, NULL),
	(34, 'Bantuan Keuangan Provinsi', 'Adalah semua jenis bantuan yang diperuntukan bagi pemerintah desa yang berasal dari\r\npemerintah provinsi.', 3, NULL, NULL),
	(35, 'Bantuan Keuangan APBD Kabupaten/Kota', 'Adalah semua jenis bantuan yang diperuntukan bagi pemerintah desa yang berasal dari APBD\r\nkabupaten/kota.', 3, NULL, NULL),
	(36, 'Pendapatan Lain-lain', 'Pendapatan desa yang belum termasuk pada rincian-rincian sebelumnya. Contohnya penerimaan\r\ndari Hasil Kerjasama antar Desa, Penerimaan dari Hasil Kerjasama Desa dengan Pihak Ketiga,\r\nPenerimaan dari Bantuan Perusahaan yang berlokasi di Desa, Hibah dan sumbangan dari Pihak\r\nKetiga, Koreksi kesalahan belanja tahun-tahun anggaran sebelumnya yang mengakibatkan\r\npenerimaan di kas Desa pada tahun anggaran berjalan, Bunga Bank dan Lain-lain pendapatan\r\nDesa yang sah', 3, NULL, NULL),
	(37, 'BLOK III. REALISASI PENDAPATAN/BELANJA PEMERINTAH', NULL, 0, NULL, NULL),
	(38, 'BELANJA DESA', 'Adalah semua pengeluaran dari rekening desa yang merupakan kewajiban desa dalam satu tahun\r\nanggaran yang tidak akan diperoleh pembayarannya kembali oleh desa. Belanja desa\r\ndipergunakan dalam rangka mendanai penyelenggaraan kewenangan desa.', 4, NULL, NULL),
	(39, 'Belanja Pegawai', 'Belanja Pegawai dianggarkan untuk pengeluaran penghasilan tetap, tunjangan, penerimaan lain,\r\ndan pembayaran jaminan sosial bagi kepala desa dan perangkat desa, serta tunjangan BPD dalam\r\nbidang penyelenggaraan pemerintahan desa', 4, NULL, NULL),
	(40, 'Belanja Barang dan Jasa', 'Belanja barang dan jasa digunakan untuk pengeluaran bagi pengadaan barang dan jasa yang nilai\r\nmanfaatnya kurang dari 12 bulan. Contohnya belanja barang perlengkapan, jasa honorarium,\r\nperjalanan dinas, jasa sewa, operasional perkantoran, pemeliharaan, barang dan jasa yang\r\ndiserahkan kepada masyarakat.\r\nBelanja barang/jasa digunakan antara lain untuk: operasional pemerintah desa, pemeliharaan\r\nsarana prasarana desa, kegiatan sosialisasi/rapat/pelatihan/bimbingan teknis, operasional BPD,\r\ninsentif RT/RW dan pemberian barang pada masyarakat/kelompok masyarakat.', 4, NULL, NULL),
	(41, 'Belanja Modal', 'Belanja modal digunakan untuk pengeluaran pengadaan barang yang nilai manfaatnya lebih dari 12\r\nbulan dan menambah aset. Contohnya belanja modal pengadaan tanah, peralatan, mesin dan alat\r\nberat, kendaraan, gedung, bangunan dan taman, jalan/prasarana jalan, jembatan,\r\nirigasi/embung/air sungai/drainase/air limbah/persampahan, jaringan/instalasi.', 4, NULL, NULL),
	(42, 'Belanja Tak Terduga', 'Belanja untuk kegiatan pada subbidang penanggulangan bencana, keadaan darurat, dan keadaan\r\nmendesak yang berskala lokal desa.', 4, NULL, NULL),
	(43, 'Bidang Penyelenggaraan Pemerintahan Desa', 'Antara lain: penyelenggaraan belanja penghasilan tetap, tunjangan dan operasional pemerintahan\r\ndesa, sarana dan prasarana pemerintahan desa, administrasi kependudukan, pencatatan sipil,\r\nstatistik dan kearsipan, tatapraja pemerintahan, perencanaan, keuangan dan pelaporan, dan\r\npertanahan.', 4, NULL, NULL),
	(44, 'Bidang Pelaksanaan Pembangunan Desa', 'Dibagi kedalam subbidang: pendidikan, kesehatan, pekerjaan umum dan penataan ruang, kawasan\r\npemukiman, kehutanan dan lingkungan hidup, perhubungan, komunikasi dan informatika, energi\r\ndan sumber daya mineral dan pariwisata.', 4, NULL, NULL),
	(45, 'Bidang Pembinaan Kemasyarakatan Desa', 'Antara lain: Ketenteraman, Ketertiban Umum, dan Pelindungan Masyarakat, Kebudayaan dan\r\nKeagamaan, Kepemudaan dan Olah Raga, dan Kelembagaan Masyarakat', 4, NULL, NULL),
	(46, 'Bidang Pemberdayaan Masyarakat', 'Antara lain: Kelautan dan Perikanan, Pertanian dan Peternakan, Peningkatan Kapasitas Aparatur\r\nDesa, Pemberdayaan Perempuan, Perlindungan Anak dan Keluarga, Koperasi, Usaha Mikro Kecil\r\ndan Menengah (UMKM), Dukungan Penanaman Modal, dan perdagangan dan perindustrian.', 4, NULL, NULL),
	(47, 'Bidang Penanggulangan Bencana, Keadaan Darurat dan Mendesak', 'Antara lain: Penanggulangan Bencana, Keadaan Darurat, dan Mendesak', 4, NULL, NULL),
	(48, 'PEMBIAYAAN', 'Pembiayaan meliputi semua penerimaan yang perlu dibayar kembali dan/atau pengeluaran yang\r\nakan diterima kembali, baik pada tahun anggaran yang bersangkutan maupun pada tahun-tahun\r\nanggaran berikutnya.\r\nPenerimaan pembiayaan antara lain: Sisa Lebih Perhitungan Anggaran (SILPA) tahun sebelumnya,\r\npencairan dana cadangan, Hasil Penjualan Kekayaan Desa/Nagari yang Dipisahkan\r\nPengeluaran pembiayaan antara lain: Pembentukan Dana Cadangan, Penyertaan Modal\r\nDesa/Nagari', 4, NULL, NULL),
	(49, 'SISA LEBIH PEMBIAYAAN TAHUN BERJALAN', 'Yaitu sisa lebih pembiayaan yang disebabkan oleh pendapatan desa dikurangi belanja desa\r\nditambah dengan pembiayaan netto', 4, NULL, NULL);
